import { findByPlaceholderText } from '@testing-library/react';
import React from 'react';
import ExpenseItem from './ExpenseItem';
import './ExpensesList.css';

const ExpensesList = props => {
    {props.items.length === 0 ? <p>No Expenses found!</p> : props.items.map((expense) => ( //u Reactu nema if ili for u curly braces, zbog tog pisemo ovakav izraz a ? jer ternarni operator u JSu po defaultu, ako je tacna tvrdnja ispisi No expenses, otherwise renderuj standardno listu
    <ExpenseItem
      key={expense.id}
      title={expense.title}
      amount={expense.amount}
      date={expense.date}
    />
  ))}  

return <ul className="expenses-list">

</ul>
};

export default ExpensesList;
